import { useEffect } from "react"

export default function RenderProducts(data, ...props) {

    useEffect(() => {
        async function render() {
            await data.map((p) => {
                console.log(p)
            })
        }

        render()
    }, [])

    return (
        <>
            <table>
                <thead>
                    <tr>
                        <td>Cod.</td>
                        <td>Descrição</td>
                        <td>Tamanho</td>
                        <td>Ação</td>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>1</td>
                        <td>parafuso</td>
                        <td>10mm</td>
                        <td><a href="#">Editar</a><a href="#">Excluir</a></td>
                    </tr>
                </tbody>
            </table>
            {/* {
            data.map((product) => {
                return <li>{product}</li>
            })
            } */}
        </>
    )
}
